openapi: 3.0.0
info:
  title: SD app
  version: 1.0.0
  description: |-
    API to communicate with SD server for variaous operations.
    Some useful links:
     - [The repository](https://github.com/karaposu/HDILOM)
     - [Confluence page](https://github.com/karaposu/HDILOM)
     
  contact:
    email: youremail@project.com
servers:
  - url: https://api_server_address.com/api/v1
  - url: https://api_server_address.com/api/v2
# tags:
#   - name: text-to-image-generation
#     description: used to generate images
#   - name: image-manipulator
#     description: used to manipulate images
paths:
  /v1/text-to-image-generation:
    post:
      summary: Process an image according to specified parameters.
      operationId: textToImageGenerator
      parameters:
         - $ref: '#/components/parameters/ApiKeyHeader'
      requestBody:
        required: true
        content:
          application/json:
            schema:
              $ref: '#/components/schemas/ImageGenerationRequest'
      responses:
        '200':
          description: Image processed successfully.
          content:
            application/json:
              schema:
                $ref: '#/components/schemas/ImageGenerationResponse'
        '400':
           $ref: '#/components/responses/BadRequestError'
        '401':
          $ref: '#/components/responses/UnauthorizedError'
        '500':
           $ref: '#/components/responses/InternalServerError'

  /v1/image-manipulation:
    post:
      summary: Process an image according to specified parameters.
      operationId: imageManipulator
      parameters:
         - $ref: '#/components/parameters/ApiKeyHeader'
      requestBody:
        required: true
        content:
          application/json:
            schema:
              $ref: '#/components/schemas/ImageManipulationRequest'
      responses:
        '200':
          description: Image processed successfully.
          content:
            application/json:
              schema:
                $ref: '#/components/schemas/ImageManipulationResponse'
        '400':
          $ref: '#/components/responses/BadRequestError'
        '401':
          $ref: '#/components/responses/UnauthorizedError'
        '500':
          $ref: '#/components/responses/InternalServerError'

  /v1/register:
    post:
      summary: Register a new user.
      operationId: registerUser
      requestBody:
        required: true
        content:
          application/json:
            schema:
              type: object
              required:
                - appVersion
                - installationId
                - timestamp
                - locale
                - platform
              properties:
                appVersion:
                  type: string
                  description: The version of the app.
                installationId:
                  type: string
                  description: A unique identifier for the app installation.
                timestamp:
                  type: string
                  format: date-time
                  description: The timestamp of the register action.
                locale:
                  type: string
                  description: The locale settings of the user.
                platform:
                  type: object
                  required:
                    - os
                    - version
                  properties:
                    os:
                      type: string
                      description: The operating system where the app is installed.
                    version:
                      type: string
                      description: The version of the operating system.
      responses:
        '200':
          description: Registration successful.
          content:
            application/json:
              schema:
                type: object
                properties:
                  message:
                    type: string
                  userId:
                    type: string
                    description: >-
                      A unique identifier assigned to the user upon
                      registration.
        '400':
          $ref: '#/components/responses/BadRequestError'
        '401':
          $ref: '#/components/responses/UnauthorizedError'
        '500':
          $ref: '#/components/responses/InternalServerError'

  /v1/increase-limit:
    post:
      summary: Increase user's limit upon payment.
      operationId: increaseUserLimit
      parameters:
         - $ref: '#/components/parameters/ApiKeyHeader'
      requestBody:
        required: true
        content:
          application/json:
            schema:
              type: object
              required:
                - userId
                - paymentConfirmationId
                - newLimit
              properties:
                userId:
                  type: string
                  description: >-
                    The unique identifier for the user whose limit is being
                    increased.
                paymentConfirmationId:
                  type: string
                  description: >-
                    A unique identifier confirming the payment has been
                    processed successfully.
                newLimit:
                  type: integer
                  description: The new limit to be applied to the user's account.
      responses:
        '200':
          description: Limit increase successful.
          content:
            application/json:
              schema:
                type: object
                properties:
                  message:
                    type: string
                  newLimit:
                    type: integer
                    description: The updated limit for the user's account.
        '400':
          $ref: '#/components/responses/BadRequestError'
        '401':
          $ref: '#/components/responses/UnauthorizedError'
        '500':
          $ref: '#/components/responses/InternalServerError'
  /v1/health:
    get:
      summary: healtcheck
      operationId: healthcheck
      responses:
        '200':
          description: healthcheck.

  /v1/source-monitoring:
    get:
      summary: >-
        source monitoring for Disk space and, memory usage, GPU usage,  queue
        lengths
      operationId: sourceMonitoring
      parameters:
         - $ref: '#/components/parameters/ApiKeyHeader'
      responses:
        '200':
          description: Image processed successfully.

  /v1/image-manipulations/user:
    post:
      summary: Endpoint to extract head part from the user image.
      requestBody:
        required: true
        content:
          application/json:
            schema:
              type: object
              required:
                - data
                - config
                - operation
              properties:
                data:
                  type: object
                  required:
                    - user_image
                  properties:
                    user_image:
                      type: string
                      description: Base64 encoded string of the user image.
                      example: ""

                config:
                  $ref: '#/components/schemas/ConfigUserImageManipulation'
                operation:
                  $ref: '#/components/schemas/Operation'
      responses:
        '200':
          description: Image processed successfully.
          content:
            application/json:
              schema:
                $ref: '#/components/schemas/UserImageManipulationResponse'
        '400':
          $ref: '#/components/responses/BadRequestError'
        '401':
          $ref: '#/components/responses/UnauthorizedError'
        '500':
          $ref: '#/components/responses/InternalServerError'

  /v1/image-manipulations/web:
    post:
      summary: Endpoint to handle DOM image manipulation requests.
      requestBody:
        required: true
        content:
          application/json:
            schema:
              type: object
              required:
                - data
                - config
                - operation
              properties:
                data:
                  $ref: '#/components/schemas/DOMImageManipulationRequestData'

                config:
                  $ref: '#/components/schemas/ImageAdjustmentConfig'
                operation:
                  $ref: '#/components/schemas/Operation'

      responses:
        '200':
          description: Image processed successfully.
          content:
            application/json:
              schema:
                $ref: '#/components/schemas/DOMImageManipulationResponse'
        '400':
          $ref: '#/components/responses/BadRequestError'
        '401':
          $ref: '#/components/responses/UnauthorizedError'
        '500':
          $ref: '#/components/responses/InternalServerError'

  /share-result:
    post:
      summary: Share the result of image processing
      requestBody:
        required: true
        content:
          application/json:
            schema:
              $ref: '#/components/schemas/ShareResultRequest'
      responses:
        '200':
          description: Bug report submitted successfully
          content:
            application/json:
              schema:
                type: object
                properties:
                  message:
                    type: string
                    example: "Thank you for reporting this issue. We will investigate it as soon as possible."

        '400':
          $ref: '#/components/responses/BadRequestError'
        '401':
          $ref: '#/components/responses/UnauthorizedError'
        '500':
          $ref: '#/components/responses/InternalServerError'

  /report-bug:
    post:
      summary: Submit a bug report
      requestBody:
        required: true
        content:
          application/json:
            schema:
               $ref: '#/components/schemas/BugReportRequest'
      responses:
        '200':
          description: Bug report submitted successfully
          content:
            application/json:
              schema:
                type: object
                properties:
                  message:
                    type: string
                    example: "Thank you for reporting this issue. We will investigate it as soon as possible."

        '400':
          $ref: '#/components/responses/BadRequestError'
        '401':
          $ref: '#/components/responses/UnauthorizedError'
        '500':
          $ref: '#/components/responses/InternalServerError'




security:
  - ApiKeyAuth: []

components:
  schemas:

    ImageManipulationRequest:
      type: object
      required:
        - operation
        - config
        - data
      properties:
        operation:
          $ref: '#/components/schemas/Operation'
        config:
          $ref: '#/components/schemas/Config'
        data:
          type: array
          items:
            $ref: '#/components/schemas/ImageManipulationRequestData'

    ImageGenerationRequest:
      type: object
      required:
        - operation
        - config
        - data
      properties:
        operation:
          $ref: '#/components/schemas/Operation'
        config:
          $ref: '#/components/schemas/Config'
        data:
          type: string
          example: "A scenic landscape with mountains in the background and a clear blue sky"



    DOMImageManipulationRequestData:
      type: object
      required:
        # - headswapSourceObjs
        - source_headswapObjs
        - target_image
      properties:
        source_headswapObjs:
          type: array
          items:
            $ref: '#/components/schemas/headswapSourceObj'
        target_image:
          type: string
          example: ""



    DOMImageManipulationResponse:
      type: object
      properties:
        operation:
          $ref: '#/components/schemas/OperationStatus'
        data:
          $ref: '#/components/schemas/DOMImageManipulationResponseData'

    UserImageManipulationResponse:
      type: object
      properties:
        operation:
          $ref: '#/components/schemas/OperationStatus2'
        data:
          $ref: '#/components/schemas/UserImageManipulationResponseData'




    ImageGenerationResponse:
      type: object
      properties:
        operation:
          $ref: '#/components/schemas/OperationStatus'
        data:
          $ref: '#/components/schemas/DOMImageManipulationResponseData'

    UserImageManipulationResponseData:
      type: object
      properties:
        images:
          type: array
          items:
            $ref: '#/components/schemas/ImagesDataforUserImageManipulationResponse'
        FD_coordinates:
          type: array
          items:
            type: integer
        skin_color:
          type: array
          items:
            type: integer
            example: [192, 151, 137]
        LM_coordinates:
          $ref: '#/components/schemas/LM_coordinates'

    ImageManipulationResponseData:
      type: object
      properties:
        images:
          type: array
          items:
            $ref: '#/components/schemas/ImagesDataforUserImageManipulationResponse'





    DOMImageManipulationResponseData:
      type: object
      properties:
        images:
          type: array
          items:
            $ref: '#/components/schemas/ImageResult'
        total_time:
          type: integer
          description: The total time taken for the operation, in seconds.
    Operation:
      type: object
      properties:
        userid:
          type: string
          example: "user1234"
        package_sent_time:
          type: string
          example: "2024-03-06T12:00:00Z"
        counter:
          type: integer
          example: 1
        link:
          type: string
          format: uri
          example: "https://api.example.com/operations/1234"
        operation_name:
          type: string
          example: "GenerateImage"

    ConfigUserImageManipulation:
      type: object
      properties:
        return_img_format:
          type: string
          enum:
            - encoded
          default: "encoded"


    Config:
      type: object
      properties:
        settings:
          type: object
          items:
            type: object
            properties:
              setting1:
                type: string
                description: setting1
              setting2:
                type: string
                description: setting2


    ImageAdjustmentConfig:
      type: object
      properties:
        ASD:
          type: object
          properties:
            skincolortransfer:
              type: integer
              description: "Enable or disable skin color transfer."
              enum: [0, 1]
            headorientation:
              type: integer
              description: "Enable or disable head orientation adjustment."
              enum: [0, 1]
            hairtransfer:
              type: integer
              description: "Enable or disable hair transfer."
              enum: [0, 1]
            generic_setting1:
              type: integer
              description: "Generic setting 1 for additional configurations."
              enum: [0, 1]
            generic_setting2:
              type: integer
              description: "Generic setting 2 for additional configurations."
              enum: [0, 1]
        return_img_format:
          type: string
          description: "Format in which the image should be returned."
          enum:
            - encoded
          default: "encoded"

    ImageManipulationRequestData:
      type: object
      properties:
        image:
          type: string
          example: ""
        text:
          type: string


    ImagesDataforUserImageManipulationResponse:
      type: object
      properties:
        head:
          type: string
          example:  ""
        headselection_mask:
          type: string
          example: ""
        head_transparent:
          type: string
          example: ""

    ImageResult:
      type: object
      properties:
        result:
          type: string
          description: The processed image data or reference.
    ImagesData:
      type: object
      properties:
        images:
          type: array
          items:
            $ref: '#/components/schemas/ImageResult'
        total_time:
          type: integer
          description: The total time taken for processing the images in seconds.

    OperationStatus2:
      type: object
      properties:
        success:
          type: boolean
          description: Indicates if the operation was successful.
        error_code:
          type: string
          nullable: true
          description: An error code if the operation failed, otherwise null.
        debug_log:
          type: string
          nullable: true
          description: Debug log information if available, otherwise null.
        package_sent_time:
          type: string
          format: time
          description: The time the package was sent.
        extra_field:
          type: string
          description: The time the package was sent.


    OperationStatus:
      type: object
      properties:
        success:
          type: boolean
          description: Indicates if the operation was successful.
        error_code:
          type: string
          nullable: true
          description: An error code if the operation failed, otherwise null.
        debug_log:
          type: string
          nullable: true
          description: Debug log information if available, otherwise null.
        package_sent_time:
          type: string
          format: time
          description: The time the package was sent.
        counter:
          type: integer
          description: A counter value associated with the operation.

    ImageManipulationResponse:
      type: object
      properties:
        operation:
          $ref: '#/components/schemas/OperationStatus'
        data:
          $ref: '#/components/schemas/ImagesData'

    ErrorResponse:
      type: object
      required:
        - errorCode
        - message
      properties:
        errorCode:
          type: string
          description: A unique identifier for the type of error encountered.
        message:
          type: string
          description: A human-readable message providing more details about the error.
        details:
          type: array
          items:
            type: object
            required:
              - field
              - issue
            properties:
              field:
                type: string
                description: The field in the request that caused the error.
              issue:
                type: string
                description: A description of the problem with the field.
          description: >-
            An optional array of detail objects for errors related to specific
            parts of the request. This can be useful for form validation errors.

    

    ShareResultRequest:
      type: object
      properties:
        operation:
            $ref: '#/components/schemas/Operation'
        data:
          type: object
          required:
            - FSCD
            - headswapped_image
          properties:
            FSCD:
              type: object
              properties:
                Include_org_img:
                  type: integer
                  enum: [ 0, 1 ]
                  example: 0
                Include_qr:
                  type: integer
                  enum: [ 0, 1 ]
                  example: 0
                placeholder:
                  type: integer
                  enum: [ 0, 1 ]
                  example: 0
            headswapped_image:
              type: string
              format: byte
              example: "UklGRtAeAABXRUJQVlA4WAoAAAAgAAAArAAAAgEA"


    headswapSourceObj:
        type: object
        required:
          - head_img
          - headselection_mask
          - FD_coordinates
          - LM_coordinates
        properties:
          head_img:
            type: string
            description: Base64 encoded image of the head to swap.
            example:   ""
          headselection_mask:
            type: string
            description: Base64 encoded mask for head selection.
            example: ""
          FD_coordinates:
            type: array
            items:
              type: integer
            example:  [ 70, 104, 280,280]

            description: Face detection coordinates as an array of integers.
          LM_coordinates:
            $ref: '#/components/schemas/LM_coordinates'




    LM_coordinates:
      type: object
      properties:
        betweeneyes:
          type: array
          items:
            type: integer
          example: [ 607, 387 ]
        nose_coordinates:
          type: array
          items:
            type: integer
          description: "An array of two integers representing the X and Y coordinates of the nose."
          example: [ 608, 402 ]
        cheek_coordinates:
          type: array
          items:
            type: integer
          description: "An array of two integers representing the X and Y coordinates of the cheek."
          example: [ 539, 435 ]
        chin_coordinates:
          type: array
          items:
            type: integer
          description: "An array of two integers representing the X and Y coordinates of the chin."
          example: [ 610, 570 ]
        eye_distance:
          type: integer
          description: "The distance between the eyes."
          example: 137
        eyegap_chin_distance:
          type: integer
          description: "The distance from the gap between the eyes to the chin."
          example: 183
      required:
        - nose_coordinates
        - cheek_coordinates
        - chin_coordinates
        - eye_distance
        - eyegap_chin_distance
      description: "Coordinates and distances defining key facial landmarks."

    BugReportRequest:
      type: object
      properties:
        operation:
            $ref: '#/components/schemas/Operation'
        data:
          type: object
          properties:
            textfield:
              type: string
              example: "headswapped image is looking weird"

  securitySchemes:
    ApiKeyAuth:
      type: apiKey
      in: header
      name: X-API-KEY
      description: API key needed to authorize requests.

  parameters:
    ApiKeyHeader:
      in: header
      name: X-API-KEY
      schema:
        type: string
      required: true
      description: API key needed to authorize requests.

  responses:
    BadRequestError:
      description: Bad request. The request body is not correctly structured or contains invalid parameters.
      content:
        application/json:
          schema:
            $ref: '#/components/schemas/ErrorResponse'
    UnauthorizedError:
      description: Unauthorized. Authentication credentials are missing or invalid.
      content:
        application/json:
          schema:
            $ref: '#/components/schemas/ErrorResponse'
    InternalServerError:
      description: Internal Server Error. An error occurred on the server while processing the request.
      content:
        application/json:
          schema:
            $ref: '#/components/schemas/ErrorResponse'